Daily Bush 2 (Mike Quasar, Third Degree / 2014)

No haircuts allowed! Your favorite bushwhacked babes are back and they're sporting the hairiest beavers you've seen in this millennium! They're sick of shaving and they're proud to take you deep inside their 'Bermuda triangles' for some sweet fur-parting fucking! Get ready for your dose of Daily Bush!

Riley Reid, Bianca Breeze, Selma Sin, Nikki Daniels

Gonzo, Hairy

